sap.ui.define(["sap/ui/core/format/DateFormat","sap/ui/core/format/NumberFormat"],function(t,e){var a=t.getInstance({pattern:"MM/dd/yyyy"});var r=e.getIntegerInstance();var n=e.getFloatInstance({maxFractionDigits:2,minFractionDigits:2});return function(t){switch(t.SQLDataType){case 3:return new sap.m.Text({text:{path:t.SourceColumn,formatter:function(t){return n.format(t)}},wrapping:false});case 4:return new sap.m.Text({text:{path:t.SourceColumn,formatter:function(t){return r.format(t)}},wrapping:false});case 91:case 93:return new sap.m.Text({text:{path:t.SourceColumn,formatter:function(t){return t?a.format(new Date(t)):null}},wrapping:false});default:return new sap.m.Text({text:"{"+t.SourceColumn+"}",wrapping:false})}}});